import "./Card.css";

export default function Card() {
  return (
    <div class="cardcontainer">
      <div class="card1">
        <p>Rapmon</p>
      </div>
      <div class="card2"></div>
      <div class="card3"></div>
      <div class="card4"></div>
      <div class="card5"></div>
      <div class="card6"></div>
    </div>
  );
}
